	dirPath, _ := filepath.Split(dir)
	dirPath = cleanPath(dirPath)

	if c.Has(dirPath) {
		return c.Get(dirPath), nil
	}

	parts := strings.Split(dir, "/")
	first := parts[0]

	if c.Has(first) {
		return c.Get(first).GetDir(strings.Join(parts[1:], "/"))
	}

	// Temporary fix for handling / rooted paths.
